import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import Toolbar from '@material-ui/core/Toolbar';
import PhotoLibraryIcon from '@material-ui/icons/PhotoLibrary'
import HomeIcon from '@material-ui/icons/Home'
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import MoneyIcon from '@material-ui/icons/AttachMoney'
import { Link } from 'react-router-dom'


const useStyles = makeStyles((theme) => ({
    text: {
      padding: theme.spacing(2, 2, 0),
    },
    paper: {
      paddingBottom: 50,
    },
    list: {
      marginBottom: theme.spacing(2),
    },
    subheader: {
      backgroundColor: theme.palette.background.paper,
    },
    appBar: {
      top: 'auto',
      bottom: 0,
    },
    grow: {
      flexGrow: 1,
    },
    fabButton: {
      position: 'absolute',
      zIndex: 1,
      top: -30,
      left: 0,
      right: 0,
      margin: '0 auto',
    },
  }));

  export default function BottomAppBar() {
    const classes = useStyles();
    const [value, setValue] = React.useState(0);

    return (

        <AppBar position="fixed" color="primary" className={classes.appBar}>
        <Toolbar>
        <BottomNavigation 
      value={value}
      onChange={(event, newValue) => {
        setValue(newValue);
      }}
      className={classes.grow}
    >
      <BottomNavigationAction style={{backgroundColor: '#3f51b5', color: '#1e0063'}} label="Home" icon={<Link to="/" style={{color: 'inherit'}}><HomeIcon /></Link>} />
      <BottomNavigationAction style={{backgroundColor: '#3f51b5', color: 'inherit'}} label="Payments" icon={<MoneyIcon />} />
      <BottomNavigationAction style={{backgroundColor: '#3f51b5', color: 'inherit'}} label="Images" icon={<PhotoLibraryIcon />} />
      </BottomNavigation>
        </Toolbar>
      </AppBar>

    )
}
